DROP TABLE IF EXISTS `zac_account_base`;
CREATE TABLE `zac_account_base` (
  `id` bigint(20) unsigned NOT NULL COMMENT '唯一标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `account_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '账户id',
  `shop_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `shop_name` varchar(255) NOT NULL DEFAULT '' COMMENT '店铺名称',
  `user_gid` varchar(50) NOT NULL DEFAULT '' COMMENT '用户gid',
  `total_assets` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '账户总资产',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '账户状态,code=ACCOUNT_STATUS',
  `version` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '更新版本号',
  `creator_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `modifier_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '修改人',
  `record_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0无效1有效)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户中心-账户基础信息表';

